// src/store/editor/actions.ts
export enum EditorActionTypes {
    ADD_ELEMENT = 'ADD_ELEMENT',
    UPDATE_ELEMENT = 'UPDATE_ELEMENT',
    DELETE_ELEMENT = 'DELETE_ELEMENT',
    UNDO = 'UNDO',
    REDO = 'REDO',
  }

  export const addElement = (type: string, position: { x: number; y: number }) => ({
    type: EditorActionTypes.ADD_ELEMENT,
    payload: { type, position },
  });

  export const updateElement = (id: string, properties: { [key: string]: any }) => ({
    type: EditorActionTypes.UPDATE_ELEMENT,
    payload: { id, properties },
  });
